import {
  Column,
  Stack,
  Card,
  Box,
  Columns,
  Inline,
  Placeholder,
  Tiles,
  Text,
  ButtonIcon,
} from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <div>
        <Tiles columns={4}>
          <ButtonIcon icon={<IconBookmark />} label='Bookmark' id='example-1' />
        </Tiles>
      </div>
    );
  }
}
